import React from "react";
import ReactDOM from "react-dom";

interface AppProps {
  color: string;
}

const App = (AppProps) => {
  return <div>{AppProps.color}</div>;
};

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.querySelector("#root")
);
